CREATE FUNCTION proc_alpha(ip_email text) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
prc_first_name text;
prc_last_name text;
prc_uber_verification text;
prc_minimum_fare int;
prc_base_fare int;
prc_per_minute_charge int;
prc_per_km_charge int;
prc_cancellation_charge int;
prc_activation_date timestamp;
trips_tot bigint;
next_trip_distance float;
next_trip_duration float;
next_trip_cost float;
customer_limit float;
eligibility_reason text;
BEGIN

 
prc_first_name := (select first_name from ride_history where email = ip_email order by request_time desc limit 1);
prc_last_name := (select last_name from ride_history where email = ip_email order by request_time desc limit 1);
prc_uber_verification := (select mobile_verified from ride_history where email = ip_email order by request_time desc limit 1);

prc_minimum_fare := (select minimum_fare from uber_fare_changes order by last_update desc limit 1); 
prc_base_fare := (select base_fare from uber_fare_changes order by last_update desc limit 1);
prc_per_minute_charge := (select per_minute_charge from uber_fare_changes order by last_update desc limit 1);
prc_per_km_charge := (select per_km_charge from uber_fare_changes order by last_update desc limit 1);
prc_cancellation_charge := (select cancellation_charge from uber_fare_changes order by last_update desc limit 1);

prc_activation_date := (select min(start_time) activation_date from ride_history where email = ip_email);
trips_tot := (select count(*) trips_mth1 from ride_history where status = 'completed' and email = ip_email);
next_trip_distance :=   (select distance_ema from (with trip_distance_ema AS (
			SELECT email, 
			request_time , 
			distance, 
			ema(distance::bigint, 0.2) OVER (PARTITION BY email ORDER BY request_time asc) next_trip_distance_ema 
			FROM ride_history),
			distance_ema_summary AS (
			SELECT distinct email, last_value(next_trip_distance_ema) OVER (PARTITION BY email ORDER BY request_time asc range between current row and unbounded following) distance_ema
			FROM trip_distance_ema)
			select email,round(coalesce(distance_ema,0),2) distance_ema from distance_ema_summary) ntd where email = ip_email);
		
next_trip_duration := (select duration_ema from (with trip_duration_ema AS (
			SELECT email, 
			request_time , 
			trip_duration_mins, 
			ema(trip_duration_mins::bigint, 0.2) OVER (PARTITION BY email ORDER BY request_time asc) next_trip_duration_ema 
			FROM ride_history),
			duration_ema_summary AS (
			SELECT distinct email, last_value(next_trip_duration_ema) OVER (PARTITION BY email ORDER BY request_time asc range between current row and unbounded following) duration_ema
			FROM trip_duration_ema)
			select email,round(coalesce(duration_ema,0),2) duration_ema from duration_ema_summary) ntd where email = ip_email);
			
next_trip_cost := (select round(((next_trip_distance*prc_per_km_charge)+(next_trip_duration*prc_per_minute_charge) + prc_minimum_fare)::numeric,0));

customer_limit := (case when prc_activation_date <= current_date-90 and trips_tot  >= 6 and 
		   prc_uber_verification = 'true' and next_trip_cost > 200 then round((next_trip_cost*1.2)::numeric,-2) 
                   else 0 end);
                   
eligibility_reason := (case when prc_activation_date >= current_date-90 then 'less than 3 mths on uber'
			when prc_uber_verification != 'true' then 'Not verified by uber'
			when next_trip_cost < 200 then 'low transaction amount'
			when trips_tot < 6 then 'low uber activity'
			else 'Qualified' end);

insert into eligibility_profile 
select now() scoring_date,ip_email email,prc_first_name first_name,prc_last_name last_name,prc_uber_verification uber_verification,prc_activation_date,
trips_tot,next_trip_distance,next_trip_duration,next_trip_cost,customer_limit,eligibility_reason;

return (select customer_limit);

END;
$$;


