CREATE FUNCTION proc_transform_data(ip_email text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
BEGIN

delete from ride_history where email = ip_email;

insert into ride_history 
(first_name,last_name,email,mobile_verified,date_data_pulled,
status,distance,request_time,start_time,start_city_name,start_city_latitude,
start_city_longitude,end_time,trip_duration,trip_duration_mins,
product_id,request_id,uuid)
select
first_name,
last_name,
email,
mobile_verified,
created_at date_data_pulled,
status,
distance*1.60934 distance,
to_timestamp(request_time) AT TIME ZONE 'EAT' request_time,
to_timestamp(start_time) AT TIME ZONE 'EAT' start_time,
start_city_name,
start_city_latitude,
start_city_longitude,
to_timestamp(end_time) AT TIME ZONE 'EAT' end_time,
to_timestamp(end_time) AT TIME ZONE 'EAT'-to_timestamp(start_time) AT TIME ZONE 'EAT' trip_duration,
date_part('minutes',to_timestamp(end_time) AT TIME ZONE 'EAT'-to_timestamp(start_time) AT TIME ZONE 'EAT' ) trip_duration_mins,
product_id,
request_id,
t1.uuid
from tbl_history t1
left join tbl_profile t2
on t1.uuid=t2.uuid
where email = ip_email;


END;
$$;


